Richard III: The Unseen Story

History Documentary hosted by Simon Farnaby, published by Channel 4 in 2013 - English narration


Information
------------------------------

In February 2013, researchers from the University of Leicester announced that they had found the body of England's most notorious monarch, Richard III, underneath one of the city's car parks. The story broke around the world and was watched by nearly five million people in an exclusive Channel 4 documentary. This special follow-up programme has mined unseen footage of the dig and tests, and conducted fresh interviews with the lead scientists, to reveal multiple new dimensions to the hunt for England's long-lost king.

